import React, {Component} from 'react';
import Options from '../admin/Options.js';


class AdminBody extends Component {
    constructor(props) {
        super(props);
  
        this.state = {
            show: this.props.show
        };

        this.on_click_manage_users = (e) => {
            e.preventDefault();
            this.setState({show: "manage users"});
        }
      }



  render() {
      if (this.state.show === "home"){
          return (
            <div>
              <a href></a>
              <Options on_click_manage_users={this.on_click_manage_users} />
              </div>);
      }
      if (this.state.show === "manage users"){
          return <div>
              <a href></a>
          </div>
      }
  }
}


export default AdminBody;
